Note that division is the same as multiplication by a reciprocal. In other words, if $b$ is nonzero, then $a \div b = a \cdot \frac{1}{b}$. Applying this rule, we get  \begin{align*}
\frac{4}{2} \div \frac{3}{(-3)}&=\frac{4}{2}\cdot \frac{(-3)}{3}\\
&=\frac{1}{2}\cdot (-3)\\
&=-\frac{3}{2} = \boxed{-\frac{1}{2}}.
\end{align*}. The answer is -\frac{1}{2}

